// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract SimpleDeFi {
    mapping(address => uint256) public deposits;
    mapping(address => uint256) public lastDepositTime;
    uint256 public interestRate = 5; // 5% interest annually
    uint256 public constant SECONDS_IN_YEAR = 31536000;

    function deposit() public payable {
        require(msg.value > 0, "Must deposit more than 0 ETH");

        // Apply yield to previous deposits before updating
        if (deposits[msg.sender] > 0) {
            uint256 timeDifference = block.timestamp - lastDepositTime[msg.sender];
            uint256 yield = deposits[msg.sender] * interestRate * timeDifference / SECONDS_IN_YEAR / 100;
            deposits[msg.sender] += yield;
        }

        deposits[msg.sender] += msg.value;
        lastDepositTime[msg.sender] = block.timestamp;
    }

    function withdraw(uint256 amount) public {
        require(amount <= deposits[msg.sender], "Insufficient funds");

        // Apply yield to the current balance
        uint256 timeDifference = block.timestamp - lastDepositTime[msg.sender];
        uint256 yield = deposits[msg.sender] * interestRate * timeDifference / SECONDS_IN_YEAR / 100;
        deposits[msg.sender] += yield;

        // Update deposit and transfer funds
        deposits[msg.sender] -= amount;
        lastDepositTime[msg.sender] = block.timestamp;
        payable(msg.sender).transfer(amount);
    }

    function checkBalance() public view returns (uint256) {
        uint256 timeDifference = block.timestamp - lastDepositTime[msg.sender];
        uint256 yield = deposits[msg.sender] * interestRate * timeDifference / SECONDS_IN_YEAR / 100;
        return deposits[msg.sender] + yield;
    }
}

